import React, { useState } from 'react'

export default function Signup() {
    const [name, setName] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [avatar, setAvatar] = useState("");
    return (
        <div className='signup-main-div'>
            <div className='signup-div'>
                <form>
                    <div className="mb-3">
                        <label className="form-label">Full Name</label>
                        <input type="text" className="form-control" value={name} onClick={(event) => {
                            setName(event.target.value);
                        }} />
                    </div>
                    <div className="mb-3">
                        <label className="form-label">Email address</label>
                        <input type="email" className="form-control" onClick={(event) => {
                            setName(event.target.value);
                        }} />
                        <div className="form-text">We'll never share your email with anyone else.</div>
                    </div>
                    <div className="mb-3">
                        <label className="form-label">Password</label>
                        <input type="password" className="form-control"value={password} onClick={(event) => {
                            setPassword(event.target.value);
                        }} />
                        <div className="form-text">your password is safe and secure  with us </div>

                    </div>
                    <div className="mb-3">
                        <label class="form-label" for="customFile">Select Profile picture</label>
                        <input type="file" class="form-control" onClick={(event) => {
                            setAvatar(event.target.value);
                        }} />
                    </div>



                    <button type="submit" className="btn btn-primary">Register</button>
                </form>
            </div>
        </div>
    )
}
